'    e.evs_title AS "Evenement",',
'    TO_CHAR(e.evs_event_date, ''DD-MM-YYYY'') AS "Datum",',
'    e.evs_location AS "Locatie",',
'    NVL((SELECT COUNT(*) FROM ENC_registrations r WHERE r.evs_event_id = e.evs_event_id AND r.rts_events_status = ''Confirmed''), 0) AS "Bevestigde deelnemers",',
'    NVL((SELECT COUNT(*) FROM ENC_registrations r WHERE r.evs_event_id = e.evs_event_id AND r.rts_events_status = ''Pending''), 0) AS "Wachtende deelnemers",',
'    NVL((',
'        SELECT SUM(t.tks_price) ',
'        FROM ENC_tickets t ',
'        JOIN ENC_registrations r ON t.tks_ticket_id = r.tks_ticket_id ',
'        WHERE r.evs_event_id = e.evs_event_id ',
'        AND r.rts_events_status = ''Confirmed''',
'    ), 0) AS "Totale opbrengst",',
'    NVL((SELECT COUNT(*) FROM ENC_notifications n WHERE n.evs_event_id = e.evs_event_id), 0) AS "Aantal notificaties",',
'    NVL((SELECT COUNT(*) FROM ENC_audit_logs a WHERE a.evs_action LIKE ''%'' || e.evs_title || ''%''), 0) AS "Aantal wijzigingen"',
'FROM ',
'    ENC_events e',
'ORDER BY ',
'    e.evs_event_date DESC;'))
